import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { actions } from "../actions/index";
import Box from "@material-ui/core/Box";
import Container from "@material-ui/core/Container";

const SpacexAddress = () => {
  const dispatch = useDispatch();
  const spacexAddresses = useSelector((state) => state.addressData);
  useEffect(() => {
    dispatch(actions.getAddress());
    //   dispatch(actions.affiliateStatsDaywise(token));
  }, [dispatch]);
  return (
    <Container>
      {spacexAddresses &&
        spacexAddresses.length &&
        spacexAddresses.map((list) => {
          return (
          <Box display="flex" flexDirection="column" bgcolor="red" my={1} px={2}>
            <Box>
              {list.manufacturer}
            </Box>


          </Box>)
        })}
    </Container>
  );
};
export default SpacexAddress;
